    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1961.
    The report begins by summarizing the weather conditions, habitat conditions, and
    water conditions during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, fish, reptiles,
    and disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, vegetation control,
    and wildfires. The resource management section discusses haying and timber removal.
    The public relations section discusses recreational uses and Refuge visitors. Items
    of interest and N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
